CREATE DATABASE IF NOT EXISTS petstore;
use petstore;

DROP TABLE if exists Animal, customer, datelookup, employee, merchandise, orders, sales, supplier;

CREATE TABLE ANIMAL (
  ANIMALID INTEGER NOT NULL,
  NAME VARCHAR(50),
  CATEGORY VARCHAR(50),
  BREED VARCHAR(50),
  DATEBORN DATE,
  GENDER VARCHAR(50),
  REGISTERED VARCHAR(50),
  COLOR VARCHAR(50),
  LISTPRICE DECIMAL(38,4)
);

CREATE TABLE CUSTOMER (
  CUSTOMERID INTEGER NOT NULL,
  PHONE VARCHAR(50),
  FIRSTNAME VARCHAR(50),
  LASTNAME VARCHAR(50), 
  ADDRESS VARCHAR(50),
  CITY VARCHAR(50),
  STATE VARCHAR(50),
  ZIPCODE VARCHAR(50)
);

CREATE TABLE DATELOOKUP (
  DATEID INTEGER NOT NULL,
  THEDATE DATE,
  MONTH VARCHAR(3),
  DAY VARCHAR(2),
  YEAR VARCHAR(4)
);

CREATE TABLE EMPLOYEE (
  EMPLOYEEID INTEGER NOT NULL,
  NAME VARCHAR(101),
  ADDRESS VARCHAR(200),
  DATEHIRED INTEGER
);

CREATE TABLE MERCHANDISE (
  MERCHANDISEID INTEGER NOT NULL,
  DESCRIPTION VARCHAR(50),
  QUANTITYONHAND INTEGER,
  LISTPRICE DECIMAL(38,4),
  CATEGORY VARCHAR(50)
);

CREATE TABLE ORDERS (
  ORDERID INTEGER NOT NULL,
  ORDERDATE INTEGER,
  RECEIVEDDATE INTEGER,
  QUANTITY INTEGER,
  COST DECIMAL(38,4),
  SHIPPINGCOST DECIMAL(38,4),
  ANIMALID INTEGER,
  MERCHANDISEID INTEGER,
  SUPPLIERID INTEGER,
  EMPLOYEEID INTEGER
);

CREATE TABLE SALES (
  SALEFACTID INTEGER NOT NULL,
  SALEID INTEGER,
  SALEDATE INTEGER,
  EMPLOYEEID INTEGER,
  CUSTOMERID INTEGER,
  ANIMALID INTEGER,
  MERCHANDISEID INTEGER,
  QUANTITY INTEGER,
  SALEPRICE DECIMAL(38,4),
  SALESTAX DECIMAL(38,4)  
);

CREATE TABLE SUPPLIER (
  SUPPLIERID INTEGER NOT NULL,
  NAME VARCHAR(50),
  CONTACTNAME VARCHAR(50),
  PHONE VARCHAR(50),
  ADDRESS VARCHAR(50),
  CITY VARCHAR(50),
  STATE VARCHAR(50),
  ZIPCODE VARCHAR(50)
);

