select count(*) from customer;
select count(*) from merchandise;
select count(*) from supplier;
select count(*) from customer;
select count(*) from orders;
select count(*) from sales;
select count(*) from employee;
select count(*) from datelookup;
select count(*) from animal;

SELECT 
    SUM((s.QUANTITY * s.SALEPRICE) + s.SALESTAX) AS TotalAmount,
    s.SALEPRICE
FROM 
    SALES s
WHERE 
    s.ANIMALID IS NOT NULL
GROUP BY 
    s.SALEPRICE WITH ROLLUP;
    
-- b
SELECT 
    a.CATEGORY,
    SUM((s.QUANTITY * s.SALEPRICE) + s.SALESTAX) AS TotalSales
FROM 
    SALES s
JOIN 
    ANIMAL a ON s.ANIMALID = a.ANIMALID
GROUP BY 
    a.CATEGORY
ORDER BY 
    TotalSales DESC
LIMIT 1;

-- c
WITH TopCategory AS (
    SELECT 
        a.CATEGORY
    FROM 
        SALES s
    JOIN 
        ANIMAL a ON s.ANIMALID = a.ANIMALID
    GROUP BY 
        a.CATEGORY
    ORDER BY 
        SUM((s.QUANTITY * s.SALEPRICE) + s.SALESTAX) DESC
    LIMIT 1
)

SELECT 
    t.CATEGORY,
    c.STATE,
    SUM((s.QUANTITY * s.SALEPRICE) + s.SALESTAX) AS TotalPrice,
    SUM(s.QUANTITY) AS TotalQuantity
FROM 
    SALES s
JOIN 
    ANIMAL a ON s.ANIMALID = a.ANIMALID
JOIN 
    CUSTOMER c ON s.CUSTOMERID = c.CUSTOMERID
JOIN 
    SALES sa ON s.ANIMALID = sa.ANIMALID AND s.SALEDATE = sa.SALEDATE
JOIN 
    TopCategory t ON a.CATEGORY = t.CATEGORY
GROUP BY 
    t.CATEGORY, c.STATE
ORDER BY 
    TotalQuantity DESC
LIMIT 1;

